                "title": "Master-Connects Privacy policy",
                "sectionTitle": "",
                "subSectionTitle": "These policies comply with Canadian law",
                "content": "Information disclosure of personal information means information about an identifiable individual that is recorded in any form will be restricted in that:",
                "content1": "(a) information relating to the race, national or ethnic origin, colour, religion, age or marital status of the individual,\n(b) information relating to the education or the medical, criminal or employment history of the individual or information relating to financial transactions in which the individual has been involved,\n(c) any identifying number, symbol or other particular assigned to the individual,\n(d) the address or blood type of the individual,\n(e) the personal opinions or views of the individual except where they are about another individual or about a proposal for a grant, an award or a prize to be made to another,\n(f) correspondence sent to the individual or by the individual that is implicitly or explicitly of a private or confidential nature, and replies to such correspondence that would reveal the contents of the original correspondence,\n(g) the views or opinions of another individual about the individual,\n(h) the views or opinions of another individual about a proposal for a grant, an award or a prize to be made to the individual by the company or a part of the company’s  references to in paragraph (e), but excluding the name of the other individual where it appears with the views or opinions of the other individual, and\n(i) the name of the individual where it appears with other personal information relating to the individual or where the disclosure of the name itself would reveal information about the individual",
                "content2": "Use of personal information:\nPersonal information  shall not, without the consent of the individual to whom it relates, be used by the company except:\n(a) for the purpose for which the information was obtained or compiled by the company or for a use consistent with that purpose; \nDisclosure of personal information.\nMarginal note: Where personal information may be disclosed\n(2) Subject to any other Act of Parliament, personal information under the control of a government or company may be disclosed",
                "content3": "(a) for the purpose for which the information was obtained or compiled by the company or for a use consistent with that purpose;\n(b) for any purpose in accordance with any Act of Parliament or any regulation made there under that authorizes its disclosure;\n(c) for the purpose of complying with a subpoena or warrant issued or order made by a court, person or body with jurisdiction to compel the production of information or for the purpose of complying with rules of court relating to the production of information;\n(d) to the Attorney General of Canada for use in legal proceedings involving the Crown in right of Canada or the Government of Canada;\n(e) to an investigative body specified in the regulations, on the written request of the body, for the purpose of enforcing any law of Canada or a province or carrying out a lawful investigation, if the request specifies the purpose and describes the information to be disclosed;\n(f) under an agreement or arrangement between the Government of Canada and company or carrying out a lawful investigation;\n(g) to a member of Parliament for the purpose of assisting the individual to whom the information relates in resolving a problem;\n(h) to officers or employees of the company for internal audit purposes, or to the office of the Comptroller General or any other person or body specified in the regulations for audit purposes;\n(i) to the Library and Archives of Canada for archival purposes;\n(j) to any person or body for research or statistical purposes if the head of the government institution\n(i) is satisfied that the purpose for which the information is disclosed cannot reasonably be accomplished unless the information is provided in a form that would identify the individual to whom it relates, and\n(ii) obtains from the person or body a written undertaking that no subsequent disclosure of the information will be made in a form that could reasonably be expected to identify the individual to whom it relates;\n(k) to any aboriginal government, association of aboriginal people, Indian band, government institution or part thereof, or to any person acting on behalf of such government, association, band, institution or part thereof, for the purpose of researching or validating the claims, disputes or grievances of any of the aboriginal peoples of Canada;\n(l) to any government institution for the purpose of locating an individual in order to collect a debt owing to Her Majesty in right of Canada by that individual or make a payment owing to that individual by Her Majesty in right of Canada; and\n(m) for any purpose where, in the opinion of the head of the institution,\n(i) the public interest in disclosure clearly outweighs any invasion of privacy that could result from the disclosure, or\n(ii) disclosure would clearly benefit the individual to whom the information relates.\nUSER DELETION INSTRUCTIONS:\n\nThe user can at any time send an email through our contact page requesting their information to be deleted and or can delete their information through their account.",
