                "content": "Within your account, we offer you the option of selecting, or deselecting services and or products depending on your requirements. in addition, we provide you with the means to update your information, provide us with additional site preference, see where we are in progress, and adjust your services on the go. We give you all information you need with effective feedback, including automated email updates on the fly. You can do this on any available screen. All you need is to login.",
