                "title": "Service dependencies- explained",
                "sectionTitle": "Service dependancy",
                "subSectionTitle": "Service dependancy",
                "content": "Web services, are in most part, integrated together due to the nature of web development. The analogy is similar to buying a car. You need the car's frame to hold all the important pieces together, making up the car. The features, don't deter the performance of the car, just enhances its feel. A website needs a frame that holds all the pieces together. The only difference is that a functioning web site requires additional features that complies to national standards, similar to a car's mandatory safety requirements.",
                "content1": "The items, below, represents service dependencies that makes the service work out of the box. Within your account, you can remove some of the items, if required, but the services will not work as expected and or be compliant to today's methods. From this, we recommend keeping the dependent services, when selecting the below service for your site.",
                "content2": "Each service has its related service dependencies, within each card. This allows you to clearly view all service descriptions. The one service, essential to understand is the image injection. Its the works associated to embedding an image. The creation of the image can be either by us or by you, depending on your preference.",
